import React, { useState } from 'react';
import AlbumTile from './AlbumTile';
import RecentlyPlayed from './RecentlyPlayed.js';
import './HomePage.css';

const Homepage = ({setSelectedSong}) => {


  return (
    <div classname='hp'>
      <div className='top'>
        <div className='gr'>greeting</div>
        <div className='recplay'><h3>recently played</h3> <RecentlyPlayed setSelectedSong={setSelectedSong}/></div>
      </div>
      <div className='albums'><p>albums</p><AlbumTile setSelectedSong={setSelectedSong} /></div>
    </div>
  );
};

export default Homepage;
